= Delete =

Removes a page. A confirmation is asked before the removal is done.
To restore a deleted document, hover over "Wiki" and then click on "Document Index". Click on the "Deleted Documents" tab then click restore to the corresponding document you want to restore.

On the Colibri skin:
{{image reference="Features.DocumentLifecycle@NewDeleteColibri.png"/}}
{{image reference="Features.DocumentLifecycle@DeleteConfirmColibri.png"/}}
{{image reference="Features.DocumentLifecycle@NewDeleteColibriConfirm.png"/}}

= Copy =

It is possible to create a copy of an existing page. To do so, you need to do a [[search>>extensions:Extension.Search Application]] with Admin Rights using the title of the page you want to copy. You will then see a "Copy" button if you hover over the "Page" menu.

After clicking on it you will be prompted to enter the location of the page you want to copy in the "Target Space" and the "Target Page" fields. Click on "Copy" and you're done!

On the Colibri skin
{{image reference="Features.DocumentLifecycle@NewCopyPageColibri.png"/}}

Choose the target space and the target page and then click on "**Copy**":

{{image reference="Features.DocumentLifecycle@NewCopyPageConfirmColibri.png"/}}

= Move/Rename =

A rename feature is available in XWiki. Its effect is to change the page name (that is, you get ##http:~/~/<server>/xwiki/bin/View/NewSpace/NewPageName## instead of ##http:~/~/<server>/xwiki/bin/View/OldSpace/OldPageName##) and all the backlinks linking to it. This means that you can easily move a page from one space to another, as well as keep them evolving with your wiki.

The rename will perform 2 refactorings:

* update backlinks
* update parent information

{{warning}}
Limitations: currently backlinks located in Objects and translated content won't be refactored.
{{/warning}}

When using the Colibri skin, you can access the rename feature for a page by clicking on "Rename" under the "Page" menu in the top menu bar:

{{image reference="Features.DocumentLifecycle@NewRenameColibri.png"/}}
{{image reference="Features.DocumentLifecycle@NewRenameConfirmColibri.png"/}}

After clicking "Rename" you will be prompted to input the "New Space" and "New Page" names you want your document to have.

Now you can link to the page using its new name.

== Limitations ==

There are still some limitations on renaming:

* backlinks have to be turned on (they are turned on by default but if you have turned them off, rename will not rename backlinks and you'll have to turn them on again to benefit from this feature)
* backlinks in objects attached to pages are not currently renamed. You can track issue [[XWIKI-981>>http://jira.xwiki.org/jira/browse/XWIKI-981]] to follow the progress.
* backlinks are saved when a page is saved thus it may happen with a clean XWiki database that backlinks are not saved. In this special case, you can call the following in a page to refresh all links (you'll need to be admin to do this):(((
{{code language="none"}}
$xwiki.refreshLinks()
{{/code}}
)))

= Share Page by Email =

You can share a page by email in XWiki. In order to do this navigate to your document, hover over the "Page" menu and click on **"Share by email"**. Fill in the required fields and then click **"Send"**.

{{warning}}
You need to have your email server configured properly for this feature to work. For more information check out the [[guide to configuring the SMTP server>>AdminGuide.Configuration#HConfiguringtheSMTPserver]].
{{/warning}}

